import React from "react";
import {motion} from "framer-motion";

export default function boxAnimation(){
    return(
        <motion.div className="box" 
        initial={{ rotate:0 }}
        whileInView={{ rotate:360 }}
        transition={{ duration: 0.5 }}
        
        />
    )
}
